import { httpAction, getAction } from '@/api/manage';
import pick from 'lodash.pick';
import AFormItem from "ant-design-vue/es/form/FormItem";
export default {
  name: "SysUserSetModal",
  components: {
    AFormItem: AFormItem
  },
  data: function data() {
    return {
      title: "操作",
      visible: false,
      model: {},
      labelCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 5
        }
      },
      wrapperCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 16
        }
      },
      confirmLoading: false,
      form: this.$form.createForm(this),
      validatorRules: {
        iId: {
          rules: [{
            required: true,
            message: '请输入iId!'
          }]
        }
      },
      url: {
        add: "/testt/sysUserSet/add",
        edit: "/testt/sysUserSet/edit"
      },
      selectedModel: null,
      modelData: []
    };
  },
  created: function created() {
    this.getBusModelList();
  },
  watch: {
    selectedModel: 'getBusModelList'
  },
  methods: {
    //下拉选列表-所属模块
    getBusModelList: function getBusModelList() {
      var _this = this;

      var url = "/papertitle/docNumSet/busModelList";
      getAction(url).then(function (res) {
        console.log(res.result);
        _this.modelData = res.result;
      });
    },
    add: function add() {
      this.edit({});
    },
    edit: function edit(record) {
      var _this2 = this;

      this.form.resetFields();
      this.model = Object.assign({}, record);
      this.visible = true;
      this.$nextTick(function () {
        _this2.form.setFieldsValue(pick(_this2.model, 'iid', 'suserId', 'iisAi', 'iisMessages', 'iisFold', 'iisCalendar', 'ibus1Id', 'ibus2Id', 'ibus3Id', 'ibus4Id')); //时间格式化

      });
    },
    close: function close() {
      this.$emit('close');
      this.visible = false;
    },
    handleOk: function handleOk() {
      var _this3 = this;

      var that = this; // 触发表单验证

      this.form.validateFields(function (err, values) {
        if (!err) {
          that.confirmLoading = true;
          var httpurl = '';
          var method = '';

          if (!_this3.model.iid) {
            httpurl += _this3.url.add;
            method = 'post';
          } else {
            httpurl += _this3.url.edit;
            method = 'put';
          }

          var formData = Object.assign(_this3.model, values); //时间格式化

          console.log(formData);
          httpAction(httpurl, formData, method).then(function (res) {
            if (res.success) {
              that.$message.success(res.message);
              that.$emit('ok');
            } else {
              that.$message.warning(res.message);
            }
          }).finally(function () {
            that.confirmLoading = false;
            that.close();
          });
        }
      });
    },
    handleCancel: function handleCancel() {
      this.close();
    }
  }
};
